import React from 'react';
import "../styles/topbar.css";

export default function Topbar() {
  return (
    <div className="topbar">
      <div className="topbar-content">  
        <h1>Logo</h1>
        <ul>
          <li><a href="#">Accueil</a></li>
          <li><a href="#">Posts</a></li>
          <li><a href="#">Account</a></li>
        </ul>
      </div>
    </div>
  )
}
